from Crypto.Cipher import DES3
from Crypto.Util.Padding import unpad
import binascii

def decrypt_des(key, ciphertext):
    cipher = DES3.new(key, DES3.MODE_ECB)
    decrypted_data = cipher.decrypt(ciphertext)
    unpadded_data = unpad(decrypted_data, DES3.block_size)
    return unpadded_data

key = "56AF98ED"
res = ""
# 将字符串类型的key和ciphertext转换为bytes类型
key = key.encode('utf-8')
ciphertext = binascii.unhexlify(res.encode('utf-8'))

# 调用解密函数
decrypted_data = decrypt_des(key, ciphertext)

# 将解密结果转换为hex字符串
hex_result = binascii.hexlify(decrypted_data).decode('utf-8')

print(hex_result)
